define(['controllerBase'], function (ControllerBase) {

    var controller = new ControllerBase('OrdensServico', 'EditarGeralDocumentos', 'ordemServicoId');

    angular
        .module(controller.moduleName)
        .registerController(controller.name, function ($scope, $injector, $http, ngNotify, FileUploader, localStorageService, fileDownloadService, OrdensServicoService) {

            $scope.dadosOs = OrdensServicoService.getDados();

            var buscarDadosLista = function () {
                $http.get('Api/OrdensServico/' + $scope.dadosOs.ordemServicoId + '/Documentos')
                   .then(
                       function (response) {
                           $scope.dados = response.data;
                       },
                       function (error) {
                           if (error.status == '403') {
                               ngNotify.set("Você não possui acesso a esse recurso", "error")
                           } else {
                               ngNotify.set("Houve um erro ao consultar a lista de documentos. Por favor, contacte o administrador do sistema. Erro: " + error.status, "error")
                           }
                       }
                    );
            };


            $scope.gerarPrevia = function (doc) {
                if (!doc) return;

                var rarImage = "data:image/png;base64,";
                var pdfImage = "data:image/png;base64,";
                var undefinedImage = "data:image/png;base64,";

                var extensaoDocumento = doc.extensao.toLowerCase();

                switch (extensaoDocumento) {
                    case "jpg":
                    case "png":
                    case "jpeg":
                    case "bmp":
                    case "tiff":
                    case "gif":
                        return "data:image/" + extensaoDocumento + ";base64," + doc.documento;

                    case "pdf":
                        return pdfImage;

                    case "rar":
                        return rarImage;

                    default:
                        return undefinedImage;
                }
            };

            // Busca o arquivo no banco.
            $scope.download = function (documentoId) {
                fileDownloadService.get('Api/DocumentosLigacoes/Download/' + documentoId, "Arquivo Ordem de Serviço")
            };

            $scope.abrirDocumento = function (doc) {
                $scope.documentoSelecionado = angular.copy(doc);

                var extensaoDocumento = doc.extensao.toLowerCase();

                //Abre modal caso seja uma foto, senão faz o download do documento
                switch (extensaoDocumento) {
                    case "jpg":
                    case "png":
                    case "jpeg":
                    case "bmp":
                    case "tiff":
                    case "gif":
                        $('#modalImagem').modal('show');
                        break;

                    default:
                        $scope.download(doc.documentoLigacaoId);
                        break;
                }

            };

            buscarDadosLista();

            // Configura a tabela
            var dtOptionsBuilder = $injector.get("DTOptionsBuilder");
            var dTColumnDefBuilder = $injector.get("DTColumnDefBuilder");

            $scope.dtOptions = dtOptionsBuilder
                .newOptions()
                .withOption('order', [])
                .withLanguageSource('assets/plugins/jquery.datatables/Portuguese-Brasil.json');

            $scope.dtColumnDefs = [
                dTColumnDefBuilder.newColumnDef(0).notSortable(),
                dTColumnDefBuilder.newColumnDef(1).notSortable(),
                dTColumnDefBuilder.newColumnDef(2).notSortable(),
                dTColumnDefBuilder.newColumnDef(3).notSortable()
            ];

            // Declaração da variável de scope e uma interna. Por alguma razão, os métodos só funcionaram usando esta forma.
            var uploader = $scope.uploader = new FileUploader({
                url: "Api/DocumentosLigacoes/Upload",
                method: 'POST',
                headers: { 'Authorization': 'Bearer ' + localStorageService.get('authorizationData').token },
                withCredentials: true,
                alias: 'arquivo'
            });

            var documentosSelecionados = [];

            // Passa o CDC para registro no banco.
            uploader.onBeforeUploadItem = function (item) {
                if ($scope.dadosOs.cdc != null) {
                    item.formData = [{ ligacaoId: $scope.dadosOs.cdc, ordemServicoId: $scope.dadosOs.ordemServicoId }];
                }
                else {
                    item.formData = [{ ordemServicoId: $scope.dadosOs.ordemServicoId }];
                }
            }

            // Recarrega a lista após o upload.
            uploader.onCompleteAll = function () {
                buscarDadosLista();
            }

            var docExclusao;
            $scope.selecionarDoc = function (id) {
                docExclusao = id;
            }

            $scope.documentosSelecionados = documentosSelecionados;

            $scope.verificarDocumentoSelecionados = function (documento) {
                for (var n = 0; n < $scope.documentosSelecionados.length; n++) {
                    if ($scope.documentosSelecionados[n] == documento) {
                        return true;
                    }
                }
            }

            $scope.selecionarDocumento = function (documento) {
                if ($scope.verificarDocumentoSelecionados(documento)) {
                    $scope.documentosSelecionados.splice($scope.documentosSelecionados.indexOf(documento), 1);
                }
                else {
                    $scope.documentosSelecionados.push(documento);
                }
            }

            $scope.selecionarTodosDocumentos = function (documentos) {
                documentos.forEach(function (documento) {
                    if (!$scope.verificarDocumentoSelecionados(documento)) {
                        $scope.documentosSelecionados.push(documento)
                    }
                })
            }

            $scope.limparTodosDocumentos = function (documentos) {
                documentos.forEach(function (documento) {
                    if ($scope.verificarDocumentoSelecionados(documento)) {
                        $scope.documentosSelecionados.splice($scope.documentosSelecionados.indexOf(documento), 1)
                    }
                })
            }

            $scope.apagarDocumento = function () {
                OrdensServicoService.excluirDoumentoOrdemServico(docExclusao)
                   .then(
                       function (response) {
                           buscarDadosLista();
                           ngNotify.set("Documento excluído com sucesso.", "success");
                           $scope.documentosSelecionados = [];
                       },
                       function (error) {
                           if (error.status == '403') {
                               ngNotify.set("Você não possui acesso a esse recurso", "error")
                           } else {
                               ngNotify.set("Houve um erro na exclusão do documento. Por favor, contacte o administrador do sistema. Erro: " + error.status, "error");
                           }
                       }
                    );
            }

            $scope.$parent.tabActive = 4;

            $scope.baixarDocumentos = function (documentos) {
                documentos.forEach(function (doc) {
                    fileDownloadService.get('Api/DocumentosLigacoes/Download/' + doc.documentoLigacaoId, "Arquivo Ordem de Serviço")
                    $scope.documentosSelecionados = [];
                })
            };

        });
});
